import React from "react";
import {Link} from "react-router-dom";
import '.css//Navigation.css';

const Navigation = (props) => {
    return (
        <div>
            <Link to="/">Home</Link>
            <Link to="/About">About</Link>
        </div>
    )
}

export default Navigation;
